DROP TABLE IF EXISTS `t_record`;
CREATE TABLE `t_record`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '记录 ID',
  `user_id` int(11) NOT NULL COMMENT '用户 ID',
  `student_number` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '学生学号',
  `real_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '学生姓名',
  `class_number` int(11) NOT NULL COMMENT '班级 ID',
  `class_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '班级名称',
  `grade` int(11) NULL DEFAULT NULL COMMENT '年级 ID',
  `status` int(11) NULL DEFAULT NULL COMMENT '记录上传状态',
  `health_upload_id` int(11) NOT NULL COMMENT '健康码上传记录 ID',
  `schedule_upload_id` int(11) NOT NULL COMMENT '行程码上传记录 ID',
  `closed_upload_id` int(11) NOT NULL COMMENT '密接查上传记录 ID',
  `upload_date` date NOT NULL COMMENT '上传日期',
  `health_image_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '健康码保存路径',
  `schedule_image_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '行程卡保存路径',
  `closed_image_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '密接查保存路径',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1252 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

